import React, { Component } from 'react'
import axios from 'axios'

export class HTTPRequest extends Component {
    constructor(props) {
        super(props)

        this.state = {
            posts: []
        }
    }

    componentDidMount() {
        axios.get('')
    }
    render() {
        return (
        <div>
            <h2>Posts</h2>
        </div>
        )
    }
}

export default HTTPRequest
